import {AppBar, Toolbar, Typography} from "@material-ui/core"

function Header(){
    const useStyles = () => {

    }

    const cspLogo = (
        <Typography variant = "h6" component = "h1">
            Generic CSP Solver
        </Typography>
    )

    const displayDesktop = () => <Toolbar>{cspLogo}</Toolbar>

    return (
        <header>
            <AppBar>
                {displayDesktop()}
            </AppBar>
        </header>
    )
}

export default Header
